import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import KeyboardArrowDownIcon from "@mui/icons-material/KeyboardArrowDown";
import Logo from "../images/Logo.png";
import MenuIcon from "@mui/icons-material/Menu";
import "./TopBar.css";

export default function ButtonAppBar() {
  return (
    <Box className="desktop" sx={{ flexGrow: 1 }}>
      <AppBar position="static" elevation={0}>
        <Toolbar sx={{ background: "white", borderBottom: "1px solid black" }}>
          <img
            src={Logo}
            alt={"ases logo"}
            style={{ marginLeft: "20px" }}
          ></img>
          <Box
            sx={{
              display: "flex",
              flexDirection: "row",
              justifyContent: "space-between",
              width: "100%",
              alignItems: "center",
              marginLeft: 1,
              whiteSpace: "nowrap",
            }}
          >
            <Typography
              sx={{
                fontFamily: "Space Grotesk",
                fontSize: 30,
                color: "#101828",
                fontWeight: "bold",
              }}
            >
              ASES
            </Typography>
            <Box
              sx={{
                display: "flex",
                flexDirection: "row",
                justifyContent: "center",
                width: "35%",
              }}
            >
              <Typography
                sx={{
                  fontFamily: "Inter",
                  fontSize: 16,
                  color: "#667085",
                  fontWeight: "bold",
                  marginRight: "20px",
                }}
              >
                Programs
                <KeyboardArrowDownIcon />
              </Typography>
              <Typography
                sx={{
                  fontFamily: "Inter",
                  fontSize: 16,
                  color: "#667085",
                  fontWeight: "bold",
                  marginRight: "20px",
                }}
              >
                About
              </Typography>
              <Typography
                sx={{
                  fontFamily: "Inter",
                  fontSize: 16,
                  color: "#667085",
                  fontWeight: "bold",
                  marginRight: "20px",
                }}
              >
                FAQ
              </Typography>
              <Typography
                sx={{
                  fontFamily: "Inter",
                  fontSize: 16,
                  color: "#667085",
                  fontWeight: "bold",
                  marginRight: "20px",
                }}
              >
                Team
              </Typography>
              <Typography
                sx={{
                  fontFamily: "Inter",
                  fontSize: 16,
                  color: "#667085",
                  fontWeight: "bold",
                  marginRight: "20px",
                }}
              >
                Sponsors
              </Typography>
            </Box>
            <Typography
              sx={{
                fontFamily: "Inter",
                fontSize: 16,
                color: "#667085",
                fontWeight: "bold",
                marginRight: "20px",
              }}
            >
              Login/Sign Up
            </Typography>
          </Box>
        </Toolbar>
        <Box className="mobile" sx={{ flexGrow: 1 }}>
          <AppBar position="static" elevation={0}>
            <Toolbar
              sx={{
                background: "white",
                borderBottom: "1px solid black",
              }}
            >
              <img
                src={Logo}
                alt={"ases logo"}
                style={{ marginLeft: "20px" }}
              ></img>
              <Box
                sx={{
                  display: "flex",
                  flexDirection: "row",
                  justifyContent: "space-between",
                  width: "100%",
                  alignItems: "center",
                  marginLeft: 1,
                  whiteSpace: "nowrap",
                }}
              >
                <Typography
                  sx={{
                    fontFamily: "Space Grotesk",
                    fontSize: 30,
                    color: "#101828",
                    fontWeight: "bold",
                  }}
                >
                  ASES
                </Typography>
                <Box>
                  <MenuIcon sx={{ color: "#667085" }} />
                </Box>
              </Box>
            </Toolbar>
          </AppBar>
        </Box>
      </AppBar>
    </Box>
  );
}
